CREATE DATABASE IF NOT EXISTS titanic;
DROP TABLE IF EXISTS titanic.train;
CREATE TABLE IF NOT EXISTS titanic.train (
pclass_1 int,
pclass_2 int,
pclass_3 int,
sex_female  int,
sex_male    int,
embarked_c  int,
embarked_q  int,
embarked_s  int,
title_master int,
title_misc  int,
title_miss  int,
title_mr    int,
title_mrs   int,
nosibsp     int,
noparch     int,
nullcabin   int,
cabinalpha  int,
family      int,
isalone     int,
ismother      int,
age         float,
realfare    float,
survived    int
);


drop table if exists titanic.test;
create table titanic.test(
